import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  width: 60px;
  height: 60px;
`;

export const Header = props => {
  return (
    <Wrapper>
      <img src='../../' href='#' alt="Avia_logo"/>
    </Wrapper>
  );
}
